import React from 'react';

import '../assets/css/InterviewCard.css';

class InterviewCard extends React.Component {
    constructor() {
        super();
    }


    render() {
        const { interviewList } = this.props;

        return (
            <div className="interview-card">
                <table >
                    <thead>
                    <tr>
                        <th>#</th>
                        <th>Company</th>
                        <th>Date</th>
                        <th>Student</th>
                    </tr>
                    </thead>
                    <tbody>
                        {interviewList.map((interview,id) => <tr key={id}><td>{id}</td><td>{interview.company}</td><td>{interview.date}</td><td>{interview.result}</td></tr>)}
                    </tbody>
                </table>
            </div>
        )
    }

}

export default InterviewCard;
